import React, { Component } from 'react'

class QuestionText extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      questionText: 'placeholder question'
    }
  }

  render() {
    return(
      <section className="question">
            <p>{this.state.questionText}</p>
      </section>
      )
    }
  }

export default QuestionText
